import React, { Component }  from 'react';

class SearchBar extends Component
{
  render()
  {
    var style = {
      alignItems: center,

    };
    return (
      <div style={{
        position: 'absolute', left: '50%', top: '50%',
        transform: 'translate(-50%, -50%)'
      }}>
        <input type="submit" value="Search..." />
      </div>
    );
  }
}

export default SearchBar;
